Which is the graph of $y = |f(x)|$?

[asy]
unitsize(0.5 cm);

picture[] graf;
int i, n;

real func(real x) {
  real y;
  if (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
  return(y);
}

real funca(real x) {
  return(func(abs(x)));
}

real funcb(real x) {
  real y = max(0,func(x));
  return(y);
}

real funcd(real x) {
  return(abs(func(x)));
}

real funce(real x) {
  return(abs(func(-x)));
}

